import React from 'react';
import '../CSS/Dashboard.css';
import CourseCard from './CourseCard'

const Dashboard = () => {
  return (
    <section className="courses-container">
      <h2>Dashboard</h2>
      <div>
      <CourseCard />
      </div>
    </section>
  )
}
export default Dashboard;
